import org.junit.Test;
import static org.junit.Assert.*;

public class RandomizedQueueTest {
    @Test public void testBasicPercolation() {
        RandomizedQueue<Integer> rq = new RandomizedQueue<Integer>();

        rq.enqueue(1);
        rq.enqueue(2);
        rq.enqueue(3);
        rq.enqueue(4);
        rq.enqueue(5);
        rq.enqueue(6);
        rq.enqueue(7);
        rq.enqueue(8);
        rq.enqueue(9);
        rq.enqueue(10);

        
        assertEquals(
            10,
            rq.size()
        );
    }
}
